import React from 'react'

import PropTypes from 'prop-types'

import './picture-card.css'

const pictureCard = (props) => {
    return (
        <div className="picture-card-container">
            <img
                alt={props.image_alt}
                src={props.image_src}
                className="picture-card-image"
            />
            <div>
                <h5 className="picture-card-text HeadingThree">{props.title}</h5>
                <span className="picture-card-text1">{props.text}</span>
            </div>
        </div>
    )
}

pictureCard.defaultProps = {
    image_src: '/playground_assets/rocket1.svg',
    image_alt: 'image',
    text: 'Get the latest design ideas and turn it into reality.',
    title: 'Design',
}

pictureCard.propTypes = {
    image_src: PropTypes.string,
    image_alt: PropTypes.string,
    text: PropTypes.string,
    title: PropTypes.string,
}

export default pictureCard
